import React from 'react';
import './App.css';
import Navigation from './components/Navigation';

//import PieChart from './components/ChartComponent';
//import Clock from './components/ClockComponent';
//import WebService from './components/WebServiceComponent';
//import WS from './components/WSComponent';

class App extends React.Component {

  constructor(props) {
    super(props);
    this.state = {

    }
  }

  render() {
    return (
      <div className="App">
        <Navigation />

        <div>
            <div class="container mt-3 mb-3">
                <div class="row">
                    <div class="col-md-4">
                        <div class="card" style="background-color: rgb(39,42,61);color: rgb(231,231,241);">
                            <div class="card-header">
                                <h4 style="color: rgb(134,136,151);">Tổng số TTHC</h4>
                            </div>
                            <div class="card-body"><i class="fas fa-file-alt" style="font-size: 30px;color: #51A3A3;"></i>
                                <h2>1089</h2>
                            </div>
                        </div>
                    </div>
                    <div class="col-md-4">
                        <div class="card" style="background-color: rgb(39,42,61);color: rgb(231,231,241);">
                            <div class="card-header">
                                <h4 style="color: rgb(134,136,151);">Sở ngành</h4>
                            </div>
                            <div class="card-body"><i class="fas fa-building" style="font-size: 30px;color: #CB904D;"></i>
                                <h2>17</h2>
                            </div>
                        </div>
                    </div>
                    <div class="col-md-4">
                        <div class="card" style="background-color: rgb(39,42,61);color: rgb(231,231,241);">
                            <div class="card-header">
                                <h4 style="color: rgb(134,136,151);">Quầy giao dịch</h4>
                            </div>
                            <div class="card-body"><i class="fas fa-desktop" style="font-size: 30px;color: #75485E;"></i>
                                <h2>22</h2>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>{/* end div First Row  */}

      </div>//end div app
    );
  }
}

export default App;
